values ('2016', v_row.DISTRICTID, 'SPF', 'D754323AE16C448AAB86064FA77B96CE', '测算地区代码表', 'CODE_T_DISTRICT_SPF', 1, '1', '0', null, ' 1=1 AND GUID IN ( SELECT GUID FROM Code_t_District_Spf  
